import './home.css';
import { useState, useEffect } from 'react';
import axios from 'axios';

const Home = () => {
    const [cata, setCata] = useState({ meals: [] });

useEffect(() => {
    const fetchData = async () => {
        const result = await axios(
            'https://www.themealdb.com/api/json/v1/1/search.php?f=a',
        );

        setCata(result.cata);
    };

    fetchData();
}, []);
    console.log(cata)
    return (
        <div>
            {cata.map(value => (
                <h1>{value.strMeal}</h1>
            ))}
          
        </div>
    );
}

export default Home;
